import React from 'react';
import HexCell from './HexCell';

function Board({ board, placeTile }) {
  return (
    <div className="board">
      {board.map((cell, index) => (
        <HexCell key={index} tile={cell} onClick={() => placeTile(index)} />
      ))}
    </div>
  );
}

export default Board;
